import React, { useContext, useEffect } from "react";
import { PokemonContext } from "../../contexts/PokemonContext";

const Navbar = () => {
  const { pokemons } = useContext(PokemonContext);

  useEffect(() => {
    console.log("navbar", pokemons.length);
    return () => {};
  }, [pokemons]);

  return (
    <div
      className={`navbar ${css`
        padding: 10px 20px;
        text-align: center;
        background: #6d3d6d;
      `}`}
    >
      <h1>Pokemon List Page</h1>
      <p>Currently you have {pokemons.length} pokemonns in collection. </p>
    </div>
  );
};

export default Navbar;
